This small BSP example demonstrates the peripheral resource management concept, though with some limitations. It builds on the previous example that turns on one board's LED. To make it interesting, the example supports three different boards: Teensy 4 i.MXRT1010EVK i.MXRT1170EVK (Cortex-M7) However, to stay concise, the example only demonstrates resource initialization for the i.MXRT1010EVK. The example uses Cargo features to select a target board. The Cargo.toml snippet below demonstrates the dependencies and feature configurations. A feature combines an imxrt-ral chip selection an imxrt-hal family selection a boot header to describe a board. The imxrt-ral and imxrt-hal features ensure that the peripherals and drivers are configured for the board's processor. Similarly, the boot header ensures that the runtime can boot the board's processor. # Cargo.toml [dependencies]
imxrt-hal = { version = "0.5" }
imxrt-ral = { version = "0.5", features = ["rt"] }
imxrt-rt = { version = "0.1", features = ["device"] } teensy4-fcb = { version = "0.4", optional = true }
imxrt1010evk-fcb = { version = "0.1", optional = true }
imxrt1170evk-fcb = { version = "0.1", optional = true } panic-halt = "0.2"
cfg-if = "1" [build-dependencies]
imxrt-rt = { version = "0.1", features = ["device"] } [features]
# board = [
# "imxrt-ral/${CHIP},
# "imxrt-hal/${FAMILY},
# "${BOOT_HEADER},
# ]
teensy4 = [ "imxrt-ral/imxrt1062", "imxrt-hal/imxrt1060", "dep:teensy4-fcb",
]
imxrt1010evk = [ "imxrt-ral/imxrt1011", "imxrt-hal/imxrt1010", "dep:imxrt1010evk-fcb",
]
imxrt1170evk-cm7 = [ "imxrt-ral/imxrt1176_cm7", "imxrt-hal/imxrt1170", "dep:imxrt1170evk-fcb",
] The build.rs runtime configuration is aware of these three boards, and it configures the runtime based on the board's chip and flash size. //! build.rs use imxrt_rt::{Family, RuntimeBuilder}; struct Board { family: Family, flash_size: usize,
} const BOARD: Board = if cfg!(feature = "teensy4") { Board { family: Family::Imxrt1060, flash_size: 1984 * 1024, }
} else if cfg!(feature = "imxrt1010evk") { Board { family: Family::Imxrt1010, flash_size: 16 * 1024 * 1024, }
} else if cfg!(feature = "imxrt1170evk-cm7") { Board { family: Family::Imxrt1170, flash_size: 16 * 1024 * 1024, }
} else { panic!("No board selected!")
}; fn main() { RuntimeBuilder::from_flexspi(BOARD.family, BOARD.flash_size) .build() .unwrap();
} Here's the application code. The board module conditionally exposes a board's Resources based on the board selection. By convention, all boards define a Resources struct, which can be taken. The object contains a led member of type Led. The Led type is an alias for an imxrt-hal GPIO output, which wraps a specific processor pin. Notice that there is no unsafe in this application code. The board module, and its submodules, make sure that board Resources are only taken once. Our dependencies are not also constructing imxrt-ral peripheral instances, which means that all unsafe peripheral instance access happens within board. //! main.rs #![no_main]
#![no_std] use imxrt_hal as hal;
use imxrt_ral as ral; use imxrt_rt::entry;
use panic_halt as _; mod board { use core::sync::atomic::{AtomicBool, Ordering}; /// Called by a board implementation to mark peripherals taken. fn take() -> Option<()> { static BOARD_FREE: AtomicBool = AtomicBool::new(true); BOARD_FREE.swap(false, Ordering::SeqCst).then_some(()) } cfg_if::cfg_if! { if #[cfg(feature = "teensy4")] { mod teensy4; pub use teensy4::Resources; } else if #[cfg(feature = "imxrt1010evk")] { mod imxrt1010evk; pub use imxrt1010evk::Resources; } else if #[cfg(feature = "imxrt1170evk-cm7")] { mod imxrt1170evk_cm7; pub use imxrt1170evk_cm7::Resources; } else { compile_error!("No board selected!"); } }
} #[entry]
fn main() -> ! { let board::Resources { led, .. } = board::Resources::take().unwrap(); led.set(); loop {}
} The i.MXRT1010EVK board implementation is shown below. The implementation demonstrates the convention of items expected by the application. If the call to super::take() returns None, it means that the imxrt-ral peripheral instances already exist, and board refuses to alias those instances and their wrapping Resources. Otherwise, this is the first time that Resources are being taken, so it's safe to create imxrt-ral peripheral instances and their drivers. //! board/imxrt1010evk.rs use crate::{ hal::{self, iomuxc::pads}, ral,
};
use imxrt1010evk_fcb as _; pub type Led = hal::gpio::Output<pads::gpio::GPIO_11>; #[non_exhaustive]
pub struct Resources { pub led: Led,
} impl Resources { pub fn take() -> Option<Self> { super::take()?; let iomuxc = unsafe { ral::iomuxc::IOMUXC::instance() }; let gpio1 = unsafe { ral::gpio::GPIO1::instance() }; let mut port = hal::gpio::Port::new(gpio1); let pads = hal::iomuxc::into_pads(iomuxc); let led = port.output(pads.gpio.p11); Some(Resources { led }) }
} The board implementation also uses the boot header crate, meeting the requirements discussed in booting . Although it's not depicted in this example, the Led type and Resources::take() implementation vary for each board. And although it's not required for this small BSP, a non_exhaustive attribute on Resources requires that users match only the board resources they expect, permitting boards to add new resources without breaking users. A BSP following this design can manage lower-level peripheral instances for the user, and present higher-level drivers to the user. Furthermore, it presents an interface that may let users port their applications across different boards. However, the approach has some limitations.

